import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";
import BlogListEntry from "./BlogPosts/BlogListEntry";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";

const useStyles = makeStyles((theme) => ({
  middleContainer: {
    width: "90%",
    margin: "auto",
    overflow: "hidden",
    [theme.breakpoints.up("md")]: {
      width: "70%",
    },
  },
}));

const RecsFaves = () => {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box className={classes.middleContainer}>
        <Typography
          variant="h1"
          style={{
            margin: "2em 0 .8em 0",
            textAlign: "center",
            fontSize: "2rem",
            lineHeight: "1.15rem",
          }}
        >
          recommendations and favorites
        </Typography>
        <Typography
          variant="h2"
          style={{
            margin: "0 0 3em 0",
            padding: "0 0 2em 0",
            textAlign: "center",
            fontSize: "1.2rem",
            borderBottom: `2px ${theme.palette.accent1.main} solid`,
          }}
        >
          coming soon... in the meantime, you can check out my wannabe-mediocre
          blogs
        </Typography>
        <BlogListEntry
          image={animalImg}
          title='"animal"'
          subtitle='the picture I found when I searched "animal" on google'
          bloglink="blogpost1"
          date="August 15, 2020"
        />
        <BlogListEntry
          image={angryCatImg}
          title="fan of cats"
          subtitle="the story of me and cats"
          bloglink="blogpost2"
          date="August 15, 2020"
        />
      </Box>
      <Contact />
    </>
  );
};

export default RecsFaves;
